INSERT INTO `wxkanjia_kanjia_list` VALUES ('1', '纤薄王者X5Max最低0元购', '20', '<p>&nbsp;vivo超薄八核旗舰vivoX5Max湖北省现已全面到货。现在，你有机会0元购买五妹啦！邀请好友为自己砍价，每砍一次就有机会立减5-20元，原价2999元的vivoX5Max，最低可以0元购买！限量20台，最短时间内砍到0元的网友，即可获得购买资格。抓紧机会，看看你的人品和手气吧！<br/></p><p><br/></p><p><strong><span style=\"color: rgb(255, 192, 0);\">活动时间：<span style=\"color: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 12px; line-height: 19.2000007629395px; white-space: pre-wrap; background-color: rgb(239, 239, 239);\"><span id=\"_baidu_bookmark_start_9\" style=\"display: none; line-height: 0px;\">&#8205;</span></span></span></strong><span id=\"_baidu_bookmark_start_11\" style=\"display: none; line-height: 0px;\">&#8205;</span>2015年4月8日17:00——4月30日17:00<span id=\"_baidu_bookmark_end_12\" style=\"display: none; line-height: 0px;\">&#8205;</span><strong><span style=\"color: rgb(255, 192, 0);\"><span style=\"color: rgb(51, 51, 51); font-family: 微软雅黑; font-size: 12px; line-height: 19.2000007629395px; white-space: pre-wrap; background-color: rgb(239, 239, 239);\"><span id=\"_baidu_bookmark_end_10\" style=\"display: none; line-height: 0px;\">&#8205;</span></span></span></strong></p><p><br/></p><p><strong><span style=\"color: rgb(255, 192, 0);\">活动规则：</span></strong></p><p><strong><span style=\"color: rgb(255, 192, 0);\"></span></strong></p><p><span id=\"_baidu_bookmark_start_22\" style=\"display: none; line-height: 0px;\">&#8205;</span><span id=\"_baidu_bookmark_start_24\" style=\"display: none; line-height: 0px;\">&#8205;</span><span id=\"_baidu_bookmark_start_30\" style=\"display: none; line-height: 0px;\">&#8205;</span><span id=\"_baidu_bookmark_start_32\" style=\"display: none; line-height: 0px;\">&#8205;</span>1、邀请好友为你砍价，每次有机会减5—20元不等；<span id=\"_baidu_bookmark_end_33\" style=\"display: none; line-height: 0px;\">&#8205;</span><span id=\"_baidu_bookmark_end_31\" style=\"display: none; line-height: 0px;\">&#8205;</span><br style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: br